script: |
  super -f text -I q10104.spq | sort > q10104.out

inputs:
  - name: q10104.spq
    data: |
      SELECT DISTINCT + col1 + + col1 + cor0.col0 FROM tab0 (FORMAT parquet) AS cor0 WHERE cor0.col2 * col0 IN ( - col1 + cor0.col0 * + cor0.col1 );
  - name: tab0

outputs:
  - name: q10104.out
    data: |
